const defualtState = {
    List: [],
  };

  const List = (state = defualtState, { type, payload }) => {

    switch (type) {
      case "add":
        return { List:[...state.List, payload] };
      default:
        return state;
    }
  };

  export default List;


  export const saveList = (payload) => {
    return {
      type: "add",
      payload: payload,
    };
  };
